import logo from './me.png';

import './App.scss';
import Navbar from './components/nav';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <Navbar></Navbar>
        <img src={logo} className="App-logo" alt="logo" style={{borderRadius: '250px'}} />
      </header>
    </div>
  );
}

export default App;
